import { gql } from "@apollo/client";

export const REGISTER = gql`
  fragment Payload on REST {
    username: String
    email: String
    password: String
  }
  mutation Register($input: Payload!) {
    register(input: $input) @rest(type: "Post", method: "POST", path: "/register") {
      status
      token
      message
    }
  }
`;
export const SUBMITCREDENTIAL = gql`
    fragment Payload on REST{
        title: String,
        value: String,
    }
    mutation SubmitCredential($input:Payload!){
        submitCredential(input:$input) @rest(type:"Post",method:"POST",path:"/addCredential"){
            status
            credential
            message
        }
    }
`;
